export const Questions=[
  {
    question:"Do you have a mother, father or sibling who has diabetes?",
    option1:"Yes",
    option2:"No"
  },
  {
    question:"For how much time do you exercise in a week?",
    option1:"Less than 150 minutes",
    option2:"More than 150 minutes"
  },
  {
    question:"How often do you eat fast food per week?",
    option1:"Zero",
    option2:"Once",
    option3:"More than once"
  }
]
